import React from 'react'

import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import 'https://s3.tradingview.com/tv.js'

function Graph( {finalSearch} ) {
  function displayGraph(){
    new TradingView.widget(
        {
        "autosize": true,
        "symbol": "NASDAQ:AAPL",
        "interval": "D",
        "timezone": "Etc/UTC",
        "theme": "light",
        "style": "1",
        "locale": "in",
        "toolbar_bg": "#f1f3f6",
        "enable_publishing": false,
        "allow_symbol_change": true,
        "container_id": "tradingview_c489f"
      });
  }

  return (
    <Form className=''>
     <p> {finalSearch} </p>

     {/* TradingView Widget BEGIN */}
      <div class="tradingview-widget-container">
        <div id="tradingview_c489f"></div>
        <div class="tradingview-widget-copyright"><a href="https://in.tradingview.com/symbols/NASDAQ-AAPL/" rel="noopener" target="_blank"><span class="blue-text">AAPL Chart</span></a> by TradingView</div>
      </div>
      {/* TradingView Widget END */}
    </Form>
  );
}

export default Graph;
